var carta1 = {
  nome: "Audi A3",
  atributos: {
    cilindrada: 1984,
    motor: 16,
    potencia: 220
  }
};

var carta2 = {
  nome: "BMW X4",
  atributos: {
    cilindrada: 1997,
    motor: 16,
    potencia: 245
  }
};

var carta3 = {
  nome: "Fiat Palio",
  atributos: {
    cilindrada: 999,
    motor: 8,
    potencia: 75
  }
};

var cartas = [carta1, carta2, carta3];
var cartaMaquina, cartaJogador;

function sortearNumero() {
  return parseInt(Math.random() * 3);
}

function sortearCarta() {
  var numeroCartaMaquina = sortearNumero();
  cartaMaquina = cartas[numeroCartaMaquina];
  var numeroCartaJogador;
  do {
    numeroCartaJogador = sortearNumero();
  } while (numeroCartaMaquina == numeroCartaJogador);
  cartaJogador = cartas[numeroCartaJogador];
  console.log(cartaMaquina);
  console.log(cartaJogador);

  var botaoSortear = document.getElementById("btnSortear");
  botaoSortear.disabled = true;
  var botaoJogar = document.getElementById("btnJogar");
  botaoJogar.disabled = false;

  exibirAtributos();
}

function obtemAtributoSelecionado() {
  var pegaOpcao = document.querySelector('input[name="atributo"]:checked');
  if (pegaOpcao == null) return "";
  else return pegaOpcao.value;
}

function jogar() {
  var valorAtributoSelecionado = obtemAtributoSelecionado();
  if (valorAtributoSelecionado == "") {
    alert("É necessário escolher um atributo!");
    return;
  }
  var valorCartaMaquina = cartaMaquina.atributos[valorAtributoSelecionado];
  var valorCartaJogador = cartaJogador.atributos[valorAtributoSelecionado];
  var resultado = document.getElementById("resultado");
  if (valorCartaMaquina > valorCartaJogador)
    resultado.innerHTML = "Você perdeu";
  else if (valorCartaMaquina < valorCartaJogador)
    resultado.innerHTML = "Você venceu";
  else resultado.innerHTML = "Você empatou com a máquina";
  displayCartas();
}

function exibirAtributos() {
  var opcoes = document.getElementById("opcoes");
  var elemento = "";
  elemento +=
    "<input type='radio' name='atributo' value='cilindrada'>cilindrada";
  elemento += "<input type='radio' name='atributo' value='motor'>motor";
  elemento += "<input type='radio' name='atributo' value='potencia'>potência";
  opcoes.innerHTML = elemento;
}

function displayCartas() {
  var display = document.getElementById("display");

  var fotoCartaMaquina = document.createElement("img");
  fotoCartaMaquina.src = cartaMaquina.atributos.imagem;
  fotoCartaMaquina.hspace = "10";
  var fotoCartaJogador = document.createElement("img");
  fotoCartaJogador.src = cartaJogador.atributos.imagem;
  fotoCartaJogador.hspace = "10";
  display.appendChild(fotoCartaMaquina);
  display.appendChild(fotoCartaJogador);
}

